import initalState from '../initalState'
import actionTypes from '../actionTypes'

export const userReducer = (state = initalState.user, action) => {
    switch (action.type) {
        case actionTypes.CREATE_USER: {
           return action.user;
        }


        default:
           return state
    }
}
